              code: "import { useNonce } from '@shopify/hydrogen'\nimport { defer } from '@shopify/remix-oxygen'\nimport {\n  Links,\n  Meta,\n  Outlet,\n  Scripts,\n  LiveReload,\n  useMatches,\n  useRouteError,\n  useLoaderData,\n  ScrollRestoration,\n  isRouteErrorResponse,\n} from '@remix-run/react'\nimport favicon from '../public/favicon.svg'\nimport resetStyles from './styles/reset.css'\nimport appStyles from './styles/app.css'\nimport { Layout } from '~/components/Layout'\n\n/**\n * This is important to avoid re-fetching root queries on sub-navigations\n * @type {ShouldRevalidateFunction}\n */\nexport const shouldRevalidate = ({\n  formMethod,\n  currentUrl,\n  nextUrl,\n}) => {\n  // revalidate when a mutation is performed e.g add to cart, login...\n  if (formMethod && formMethod !== 'GET') {\n    return true\n  }\n\n  // revalidate when manually revalidating via useRevalidator\n  if (currentUrl.toString() === nextUrl.toString()) {\n    return true\n  }\n\n  return false\n}\n\nexport function links() {\n  return [\n    { rel: 'stylesheet', href: resetStyles },\n    { rel: 'stylesheet', href: appStyles },\n    {\n      rel: 'preconnect',\n      href: 'https://cdn.shopify.com',\n    },\n    {\n      rel: 'preconnect',\n      href: 'https://shop.app',\n    },\n    { rel: 'icon', type: 'image/svg+xml', href: favicon },\n  ]\n}\n\n/**\n * @return {LoaderReturnData}\n */\nexport const useRootLoaderData = () => {\n  const [root] = useMatches()\n  return root?.data\n}\n\n/**\n * @param {LoaderFunctionArgs}\n */\nexport async function loader({ context }) {\n  const { storefront, session, cart } = context\n  const customerAccessToken = await session.get(\n    'customerAccessToken',\n  )\n  const publicStoreDomain = context.env.PUBLIC_STORE_DOMAIN\n\n  // validate the customer access token is valid\n  const { isLoggedIn, headers } =\n    await validateCustomerAccessToken(\n      session,\n      customerAccessToken,\n    )\n\n  // defer the cart query by not awaiting it\n  const cartPromise = cart.get()\n\n  // defer the footer query (below the fold)\n  const footerPromise = storefront.query(FOOTER_QUERY, {\n    cache: storefront.CacheLong(),\n    variables: {\n      footerMenuHandle: 'footer', // Adjust to your footer menu handle\n    },\n  })\n\n  // await the header query (above the fold)\n  const headerPromise = storefront.query(HEADER_QUERY, {\n    cache: storefront.CacheLong(),\n    variables: {\n      headerMenuHandle: 'main-menu', // Adjust to your header menu handle\n    },\n  })\n\n  return defer(\n    {\n      cart: cartPromise,\n      footer: footerPromise,\n      header: await headerPromise,\n      isLoggedIn,\n      publicStoreDomain,\n    },\n    { headers },\n  )\n}\n\nexport default function App() {\n  const nonce = useNonce()\n  /** @type {LoaderReturnData} */\n  const data = useLoaderData()\n\n  return (\n    <html lang='en' style={{ backgroundColor: '#FFFFFF' }}>\n      <head>\n        <meta charSet='utf-8' />\n        <meta\n          name='viewport'\n          content='width=device-width,initial-scale=1'\n        />\n        <Meta />\n        <Links />\n      </head>\n      <body>\n        <Layout {...data}>\n          <Outlet />\n        </Layout>\n        <ScrollRestoration nonce={nonce} />\n        <Scripts nonce={nonce} />\n        <LiveReload nonce={nonce} />\n      </body>\n    </html>\n  )\n}\n\nexport function ErrorBoundary() {\n  const error = useRouteError()\n  const rootData = useRootLoaderData()\n  const nonce = useNonce()\n  let errorMessage = 'Unknown error'\n  let errorStatus = 500\n\n  if (isRouteErrorResponse(error)) {\n    errorMessage = error?.data?.message ?? error.data\n    errorStatus = error.status\n  } else if (error instanceof Error) {\n    errorMessage = error.message\n  }\n\n  return (\n    <html lang='en'>\n      <head>\n        <meta charSet='utf-8' />\n        <meta\n          name='viewport'\n          content='width=device-width,initial-scale=1'\n        />\n        <Meta />\n        <Links />\n      </head>\n      <body>\n        <Layout {...rootData}>\n          <div className='route-error'>\n            <h1>Oops</h1>\n            <h2>{errorStatus}</h2>\n            {errorMessage && (\n              <fieldset>\n                <pre>{errorMessage}</pre>\n              </fieldset>\n            )}\n          </div>\n        </Layout>\n        <ScrollRestoration nonce={nonce} />\n        <Scripts nonce={nonce} />\n        <LiveReload nonce={nonce} />\n      </body>\n    </html>\n  )\n}\n\n/**\n * Validates the customer access token and returns a boolean and headers\n * @see https://shopify.dev/docs/api/storefront/latest/objects/CustomerAccessToken\n *\n * @example\n * ```js\n * const {isLoggedIn, headers} = await validateCustomerAccessToken(\n *  customerAccessToken,\n *  session,\n * );\n * ```\n * @param {LoaderFunctionArgs['context']['session']} session\n * @param {CustomerAccessToken} [customerAccessToken]\n */\nasync function validateCustomerAccessToken(\n  session,\n  customerAccessToken,\n) {\n  let isLoggedIn = false\n  const headers = new Headers()\n  if (\n    !customerAccessToken?.accessToken ||\n    !customerAccessToken?.expiresAt\n  ) {\n    return { isLoggedIn, headers }\n  }\n\n  const expiresAt = new Date(\n    customerAccessToken.expiresAt,\n  ).getTime()\n  const dateNow = Date.now()\n  const customerAccessTokenExpired = expiresAt < dateNow\n\n  if (customerAccessTokenExpired) {\n    session.unset('customerAccessToken')\n    headers.append('Set-Cookie', await session.commit())\n  } else {\n    isLoggedIn = true\n  }\n\n  return { isLoggedIn, headers }\n}\n\nconst MENU_FRAGMENT = `#graphql\n  fragment MenuItem on MenuItem {\n    id\n    resourceId\n    tags\n    title\n    type\n    url\n  }\n  fragment ChildMenuItem on MenuItem {\n    ...MenuItem\n  }\n  fragment ParentMenuItem on MenuItem {\n    ...MenuItem\n    items {\n      ...ChildMenuItem\n    }\n  }\n  fragment Menu on Menu {\n    id\n    items {\n      ...ParentMenuItem\n    }\n  }\n`\n\nconst HEADER_QUERY = `#graphql\n  fragment Shop on Shop {\n    id\n    name\n    description\n    primaryDomain {\n      url\n    }\n    brand {\n      logo {\n        image {\n          url\n        }\n      }\n    }\n  }\n  query Header(\n    $country: CountryCode\n    $headerMenuHandle: String!\n    $language: LanguageCode\n  ) @inContext(language: $language, country: $country) {\n    shop {\n      ...Shop\n    }\n    menu(handle: $headerMenuHandle) {\n      ...Menu\n    }\n  }\n  ${MENU_FRAGMENT}\n`\n\nconst FOOTER_QUERY = `#graphql\n  query Footer(\n    $country: CountryCode\n    $footerMenuHandle: String!\n    $language: LanguageCode\n  ) @inContext(language: $language, country: $country) {\n    menu(handle: $footerMenuHandle) {\n      ...Menu\n    }\n  }\n  ${MENU_FRAGMENT}\n`\n\n/** @typedef {import('@shopify/remix-oxygen').LoaderFunctionArgs} LoaderFunctionArgs */\n/** @typedef {import('@remix-run/react').ShouldRevalidateFunction} ShouldRevalidateFunction */\n/** @typedef {import('@shopify/hydrogen/storefront-api-types').CustomerAccessToken} CustomerAccessToken */\n/** @typedef {import('@shopify/remix-oxygen').SerializeFrom<typeof loader>} LoaderReturnData */\n",
