          code: "// Virtual entry point for the app\nimport * as remixBuild from '@remix-run/dev/server-build';\nimport {\n  cartGetIdDefault,\n  cartSetIdDefault,\n  createCartHandler,\n  createStorefrontClient,\n  storefrontRedirect,\n} from '@shopify/hydrogen';\nimport {\n  createRequestHandler,\n  getStorefrontHeaders,\n  createCookieSessionStorage,\n} from '@shopify/remix-oxygen';\n\n/** The getLoadContext is used both here in server.js, and by Utopia's storyboard.js */\nexport const getLoadContext =\n  (env, executionContext, mockCartID) => async (request) => {\n    const waitUntil = executionContext.waitUntil.bind(executionContext);\n    const [cache, session] = await Promise.all([\n      caches.open('hydrogen'),\n      HydrogenSession.init(request, [env.SESSION_SECRET]),\n    ]);\n\n    /**\n     * Create Hydrogen's Storefront client.\n     */\n    const {storefront} = createStorefrontClient({\n      cache,\n      waitUntil,\n      i18n: getLocaleFromRequest(request),\n      publicStorefrontToken: env.PUBLIC_STOREFRONT_API_TOKEN,\n      privateStorefrontToken: env.PRIVATE_STOREFRONT_API_TOKEN,\n      storeDomain: env.PUBLIC_STORE_DOMAIN,\n      storefrontId: env.PUBLIC_STOREFRONT_ID,\n      storefrontHeaders: getStorefrontHeaders(request),\n    });\n\n    /*\n     * Create a cart handler that will be used to\n     * create and update the cart in the session.\n     */\n\n    const IS_TEST_ENVIRONMENT = typeof window !== 'undefined';\n\n    const cart = createCartHandler({\n      storefront,\n      getCartId:\n        mockCartID != null\n          ? () => mockCartID\n          : cartGetIdDefault(request.headers),\n      setCartId: IS_TEST_ENVIRONMENT ? () => {} : cartSetIdDefault(),\n      cartQueryFragment: CART_QUERY_FRAGMENT,\n    });\n\n    return {session, storefront, cart, env, waitUntil};\n  };\n\n/**\n * Export a fetch handler in module format.\n */\nexport default {\n  /**\n   * @param {Request} request\n   * @param {Env} env\n   * @param {ExecutionContext} executionContext\n   */\n  async fetch(request, env, executionContext) {\n    try {\n      /**\n       * Open a cache instance in the worker and a custom session instance.\n       */\n      if (!env?.SESSION_SECRET) {\n        throw new Error('SESSION_SECRET environment variable is not set');\n      }\n\n      // this is pretty ugly but we need to pre-create the Remix Context to have access to the storefront later in this function\n      const loadContext = getLoadContext(env, executionContext)(request);\n\n      /**\n       * Create a Remix request handler and pass\n       * Hydrogen's Storefront client to the loader context.\n       */\n      const handleRequest = createRequestHandler({\n        build: remixBuild,\n        mode: process.env.NODE_ENV,\n        getLoadContext: () => loadContext,\n      });\n\n      const response = await handleRequest(request);\n\n      if (response.status === 404) {\n        /**\n         * Check for redirects only when there's a 404 from the app.\n         * If the redirect doesn't exist, then `storefrontRedirect`\n         * will pass through the 404 response.\n         */\n        return storefrontRedirect({\n          request,\n          response,\n          storefront: loadContext.storefront,\n        });\n      }\n\n      return response;\n    } catch (error) {\n      // eslint-disable-next-line no-console\n      console.error(error);\n      return new Response('An unexpected error occurred', {status: 500});\n    }\n  },\n};\n\n/**\n * @returns {I18nLocale}\n * @param {Request} request\n */\nfunction getLocaleFromRequest(request) {\n  const defaultLocale = {language: 'EN', country: 'US'};\n  const supportedLocales = {\n    ES: 'ES',\n    FR: 'FR',\n    DE: 'DE',\n    JP: 'JA',\n  };\n\n  const url = new URL(request.url);\n  const firstSubdomain = url.hostname.split('.')[0]?.toUpperCase();\n\n  return supportedLocales[firstSubdomain]\n    ? {language: supportedLocales[firstSubdomain], country: firstSubdomain}\n    : defaultLocale;\n}\n\n/**\n * This is a custom session implementation for your Hydrogen shop.\n * Feel free to customize it to your needs, add helper methods, or\n * swap out the cookie-based implementation with something else!\n */\nexport class HydrogenSession {\n  #sessionStorage;\n  #session;\n\n  /**\n   * @param {SessionStorage} sessionStorage\n   * @param {Session} session\n   */\n  constructor(sessionStorage, session) {\n    this.#sessionStorage = sessionStorage;\n    this.#session = session;\n  }\n\n  /**\n   * @static\n   * @param {Request} request\n   * @param {string[]} secrets\n   */\n  static async init(request, secrets) {\n    const storage = createCookieSessionStorage({\n      cookie: {\n        name: 'session',\n        httpOnly: true,\n        path: '/',\n        sameSite: 'lax',\n        secrets,\n      },\n    });\n\n    const session = await storage.getSession(request.headers.get('Cookie'));\n\n    return new this(storage, session);\n  }\n\n  get has() {\n    return this.#session.has;\n  }\n\n  get get() {\n    return this.#session.get;\n  }\n\n  get flash() {\n    return this.#session.flash;\n  }\n\n  get unset() {\n    return this.#session.unset;\n  }\n\n  get set() {\n    return this.#session.set;\n  }\n\n  destroy() {\n    return this.#sessionStorage.destroySession(this.#session);\n  }\n\n  commit() {\n    return this.#sessionStorage.commitSession(this.#session);\n  }\n}\n\n// NOTE: https://shopify.dev/docs/api/storefront/latest/queries/cart\nconst CART_QUERY_FRAGMENT = `#graphql\n  fragment Money on MoneyV2 {\n    currencyCode\n    amount\n  }\n  fragment CartLine on CartLine {\n    id\n    quantity\n    attributes {\n      key\n      value\n    }\n    cost {\n      totalAmount {\n        ...Money\n      }\n      amountPerQuantity {\n        ...Money\n      }\n      compareAtAmountPerQuantity {\n        ...Money\n      }\n    }\n    merchandise {\n      ... on ProductVariant {\n        id\n        availableForSale\n        compareAtPrice {\n          ...Money\n        }\n        price {\n          ...Money\n        }\n        requiresShipping\n        title\n        image {\n          id\n          url\n          altText\n          width\n          height\n\n        }\n        product {\n          handle\n          title\n          id\n        }\n        selectedOptions {\n          name\n          value\n        }\n      }\n    }\n  }\n  fragment CartApiQuery on Cart {\n    id\n    checkoutUrl\n    totalQuantity\n    buyerIdentity {\n      countryCode\n      customer {\n        id\n        email\n        firstName\n        lastName\n        displayName\n      }\n      email\n      phone\n    }\n    lines(first: $numCartLines) {\n      nodes {\n        ...CartLine\n      }\n    }\n    cost {\n      subtotalAmount {\n        ...Money\n      }\n      totalAmount {\n        ...Money\n      }\n      totalDutyAmount {\n        ...Money\n      }\n      totalTaxAmount {\n        ...Money\n      }\n    }\n    note\n    attributes {\n      key\n      value\n    }\n    discountCodes {\n      code\n      applicable\n    }\n  }\n`;\n\n/** @typedef {import('@shopify/remix-oxygen').SessionStorage} SessionStorage */\n/** @typedef {import('@shopify/remix-oxygen').Session} Session */\n",
